// App.js
import { useState } from "react";

function App() {
  async function fetchData() {
    const options = { method: "GET" };
    const response = await fetch("http://localhost:8000/things", options);
    const result = await response.json();
    setData(result);
  }

  return (
    <main>
      <h1>Basic FARM Stack</h1>
    </main>
  );
}

export default App;
